import axios from 'axios';
import React, {Fragment, useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux'
import {withRouter} from "react-router-dom";

const Navbar = (props) => {

    const t = useSelector(state => state.translations.translations);
    const [updated, setUpdated] = useState(false);
    const dispatch = useDispatch();


    useEffect(() => {

        if(!updated){

            setUpdated(true)
        }

    }, []);



    const UI = () => {
        return (
            <Fragment>
                <nav className="main-nav on custom-scroll">
        <div className="logo-warpper"><a href="messenger.html"><img src="../assets/images/logo/logo.png" alt="logo"/></a></div>
        <div className="sidebar-main">
          <ul className="sidebar-top">
            <li><a className="button-effect" href="status" data-tippy-content="status" data-intro="Check Status here">
                <div className="user-popup status one">
                  <div> <img className="bg-img" src="../assets/images/avtar/2.jpg" alt="Avatar"/></div>
                </div></a></li>
            <li><a className="icon-btn btn-light button-effect" href="favourite" data-tippy-content="Favourite"><i className="fa fa-star">               </i></a></li>
            <li><a className="icon-btn btn-light button-effect" href="document" data-tippy-content="Document"> <i className="fa fa-file-text">       </i></a></li>
            <li><a className="icon-btn btn-light button-effect" href="contact-list" data-tippy-content="Contact List"> <i className="fa fa-users">  </i></a></li>
            <li>
              <div className="dot-btn dot-danger grow"><a className="icon-btn btn-light button-effect" href="notification" data-tippy-content="Notification"> <i className="fa fa-bell"></i></a></div>
            </li>
            <li><a className="icon-btn btn-light button-effect" href="settings" data-tippy-content="Setting" data-intro="You can change settings by clicking here"> <i className="fa fa-cog"></i></a></li>
          </ul>
          <ul className="sidebar-bottom">         
            <li><a className="icon-btn btn-light button-effect mode" href="#" data-tippy-content="Theme Mode" data-intro="Change mode"><i className="fa fa-moon-o"></i></a></li>
            <li><a className="icon-btn btn-light" href="login.html" data-tippy-content=" SignOut"> <i className="fa fa-power-off">  </i></a></li>
          </ul>
        </div>
      </nav>
            </Fragment>
        )
    }

    return (
        <Fragment>
            {UI()}
        </Fragment>
    )

}

export default withRouter(Navbar)
